import React,{Component} from 'react';
import './Newbottom.css'
class NewBottom extends Component{
    
    render(){
        return(
            <div className="new-bottom">
                <div className="row">
                    <div className='col'>
                        <img src="http://localhost:4000/anh/ao"></img>
                    </div>
                    <div className='col'>
                        <img src="http://localhost:4000/anh/quan"></img>
                    </div>
                </div>
                <div className="row-2">
                    <img src="http://localhost:4000/anh/vay"></img>
                </div>
            </div>
        )
}}
export default NewBottom
